INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES 
(39, 39, 1, 'Panthera leo', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0">The lion is a member of the family Felidae and one of four big cats in the genus Panthera. With some males exceeding 250 kg (550 lb) in weight, it is the second-largest living cat after the tiger. Wild lions currently exist in Sub-Saharan Africa and in Asia with a critically endangered remnant population in northwest India, having disappeared from North Africa, the Middle East, and Western Asia in historic times. Until the late Pleistocene (about 10,000 years ago), the lion was the most widespread large land mammal beside humans.</FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0">The lion is a member of the family Felidae and one of four big cats in the genus Panthera. With some males exceeding 250 kg (550 lb) in weight, it is the second-largest living cat after the tiger. Wild lions currently exist in Sub-Saharan Africa and in Asia with a critically endangered remnant population in northwest India, having disappeared from North Africa, the Middle East, and Western Asia in historic times.', '', 1242939451, 1),
(40, 40, 1, 'Panthera pardus', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0">The leopard is a member of the Felidae family and the smallest of the four &quot;big cats&quot; in the genus Panthera; the other three are the tiger, lion and jaguar. Once distributed across southern Asia and Africa, from Korea to South Africa, the leopard&apos;s range of distribution has decreased radically over time due to hunting and loss of habitat, and the leopard now chiefly occurs in sub-Saharan Africa. There are fragmented populations in Pakistan, India, Indochina, Malaysia, and China.</FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT><TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0"></FONT></P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT"><FONT FACE="Verdana" SIZE="10" COLOR="#0B333C" LETTERSPACING="0" KERNING="0">The leopard is a member of the Felidae family and the smallest of the four &quot;big cats&quot; in the genus Panthera; the other three are the tiger, lion and jaguar. Once distributed across southern Asia and Africa, from Korea to South Africa, the leopard&apos;s range of distribution has decreased radically over time due to hunting and loss of habitat, and the leopard now chiefly occurs in sub-Saharan Africa.', '', 1242939413, 1),
(53, 53, 1, 'Linnaeus Next Generation', '<iframe src="sites/all/flex/main.html" width="100%" height="600px" frameborder="0" />', '<iframe src="sites/all/flex/main.html" width="100%" height="600px" frameborder="0" />', '', 1242939309, 2),
(56, 56, 1, 'Select language', '', '', '', 1242943102, 1),
(57, 57, 1, 'Linnaeus Project Settings', '', '', '', 1243194543, 0),
(63, 63, 1, 'test', 'test topic', 'test topic', '', 1243194736, 1),
(38, 38, 1, 'Acinonyx jubatus', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT">The <B><I><U>cheetah</U></I></B> is an a-typical member of the cat family (Felidae) that is unique in its speed, while lacking climbing abilities. Therefore it is placed in its own genus, Acinonyx. It is the fastest land animal, reaching speeds between 112 and 120 km/h (70 and 75 mph) in short bursts covering distances up to 460 m (1,500 ft), and has the ability to accelerate from 0 to 110 km/h (68 mph) in three seconds, faster than most supercars. Recent studies confirm the cheetah&apos;s status as fastest land animal.</P></TEXTFORMAT>', '<TEXTFORMAT LEADING="2"><P ALIGN="LEFT">The <B><I><U>cheetah</U></I></B> is an a-typical member of the cat family (Felidae) that is unique in its speed, while lacking climbing abilities. Therefore it is placed in its own genus, Acinonyx. It is the fastest land animal, reaching speeds between 112 and 120 km/h (70 and 75 mph) in short bursts covering distances up to 460 m (1,500 ft), and has the ability to accelerate from 0 to 110 km/h (68 mph) in three seconds, faster than most supercars. Recent studies confirm the cheetah&apos;s status as fastest land animal.</P></TEXTFORMAT>', '', 1242939550, 2);
