(40, 'node', ' panthera pardus the leopard is a member of the felidae family and the smallest of the four big cats in the genus panthera the other three are the tiger lion and jaguar once distributed across southern asia and africa from korea to south africa the leopard s range of distribution has decreased radically over time due to hunting and loss of habitat and the leopard now chiefly occurs in subsaharan africa there are fragmented populations in pakistan india indochina malaysia and china  ', 1242939413);
